sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

gs.info('Test Value ' + inputs.id);

    try {
        var restMessage = new sn_ws.RESTMessageV2();
        restMessage.setEndpoint('https://ac994e.myshopify.com/admin/api/2023-10/orders.json');
        restMessage.setHttpMethod('POST');

        // Set headers
        restMessage.setRequestHeader('X-Shopify-Access-Token', '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');
        restMessage.setRequestHeader('Content-Type', 'application/json');

        // Set the request body
        var requestBody = {
            "order": {
                "line_items": [
                    {
                        "variant_id": inputs.id,
                        "quantity": 1
                    }
                ]
            }
        };
        restMessage.setRequestBody(JSON.stringify(requestBody));

        // Send the request and get the response
        var response = restMessage.execute();
        var responseBody = response.getBody();
        var httpStatus = response.getStatusCode();

        // Log or process the response
        gs.info('HTTP Status: ' + httpStatus);
        gs.info('Response Body: ' + responseBody);
        outputs.response = responseBody
        outputs.status = httpStatus
    } catch (ex) {
        gs.error('Error occurred: ' + ex.message);
    }


})(inputs, outputs);

